import React from 'react';

function App() {
  return (
    <div className="min-h-screen bg-gradient-to-r from-purple-500 to-pink-500">
      <div className="container mx-auto px-4 py-8">
        <header className="bg-white rounded-lg shadow-lg p-6 mb-8">
          <h1 className="text-3xl font-bold text-purple-800">ChicSuite</h1>
          <p className="text-gray-600">Sistema de Gestão para Salão de Beleza</p>
        </header>
        
        <main>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            <div className="bg-white rounded-lg shadow-lg p-6 hover:shadow-xl transition-shadow">
              <h2 className="text-xl font-bold text-purple-800 mb-2">Bem-vindo ao ChicSuite</h2>
              <p className="text-gray-600">Sistema em construção...</p>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}

export default App;
